    if len(numbers) < 2:
        return None
    highest = numbers[0]
    lowest = numbers[0]
    for num in numbers[1:]:
        if num > highest:
            highest = num
        if num < lowest:
            lowest = num
    if highest % lowest == 0:
        return (highest, lowest)
    if is_prime(lowest):
        return (highest, lowest)
    return (lowest, highest)

